 (1,39,'Giới Thiệu Công Ty',0x67696F692D74686965752D636F6E672D7479,'','<p>Gioi theiu ve cong ty o day...</p>','',1,0,0,2,'2013-10-29 11:50:54',747,'','2013-10-29 15:58:43',747,0,'0000-00-00 00:00:00','2013-10-29 11:50:54','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,0,'','',1,38,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),
 (2,43,'Việc Làm 01',0x766965632D6C616D2D3031,'','<p>Việc Làm 01. Việc Làm 01. Việc Làm 01. Việc Làm 01. Việc Làm 01. Việc Làm 01.</p>\r\n','\r\n<p> </p>\r\n<p> Hôm nay, sau một tuần tìm kiếm trong vô vọng xác nạn nhân Lê Thị Thanh Huyền, người bị ném xuống sông Hồng theo lời khai của nghi can Nguyễn Mạnh Tường (Giám đốc Thẩm mỹ viện Cát Tường), Giám đốc công an Hà Nội, Nguyễn Đức Chung khẳng định cơ quan điều tra không bỏ cuộc. Hiện vẫn có 10 thợ lặn tìm kiếm xác chị Huyền dọc từ đầu cầu Thanh Trì (Hà Nội) đến cầu Yên Lệnh (Hưng Yên).<br /><br />Tướng Chung nhận định, đủ cơ sở để tin rằng chị Huyền đã bị ném xuống sông theo lời khai của nghi can Tường. \"Chúng tôi có nhân chứng về việc này\", ông nói.<br /><br />Người đứng đầu Công an Hà Nội cho biết, không còn cách nào khác tìm xác nạn nhân ngoài biện pháp mò lặn, thả câu. “Chúng tôi quyết bằng mọi giá phải tìm được xác nạn nhân”, tướng Chung khẳng định.<br /><br />Ông cho hay theo tổng kết kỹ thuật hình sự thế giới, với người chết đuối thường 5-7 ngày xác sẽ nổi lên, điều này tùy thuộc vào điều kiện thời tiết nóng hay lạnh. Tuy nhiên, với những trường hợp xác bị ném, có thể phải từ 18 đến 25 ngày mới nổi.<br /><br />Theo một số chuyên gia luật hình sự, tài liệu, chứng cứ của vụ án đủ cơ sở để xác định bị can đã phạm tội Giết người. Do đó, việc phải tìm thấy thi thể nạn nhận không còn là điều kiện bắt buộc.<br />nc2-6304-1383039213.jpg<br /><br />Tại khu vực chân cầu Thanh Trì (Hà Nội), người nhà nạn nhân vẫn kiên trì tổ chức tìm kiếm. Ảnh: Hữu Nam<br /><br />Vụ án xảy ra tại thẩm mỹ viện Cát Tường đã khiến dư luận bàng hoàng bức xúc. Hàng loạt các đơn vị chức năng đã vào cuộc điều tra xác minh vụ việc. Hôm qua, Phó thủ tướng Nguyễn Thiện Nhân cũng yêu cầu Bộ Y tế, ngành y tế Hà Nội xác định rõ trách nhiệm của các bên liên quan và chấn chỉnh hoạt động của các cơ sở y tế tư nhân.<br /><br />Trước đó, Bộ trưởng Y tế Nguyễn Kim Tiến thừa nhận thấy “đau đớn, xót xa và nặng nề” về vấn đề y đức.<br /><br />Theo lời khai của ông Tường, sáng 19/10 chị Huyền đến Thẩm mỹ viện Cát Tường do ông ta làm chủ ở số 45 đường Giải Phóng để hút mỡ bụng và nâng ngực. Sau nhiều tiếng phẫu thuật, đến 16h cùng ngày, thiếu phụ 39 tuổi nặng 49 kg thấy chóng mặt, người tím tái, sùi bọt mép và tử vong. Tối hôm đó, ông Tường cùng nhân viên bảo vệ Đào Quang Khánh bê nạn nhân ra ôtô chở đến cầu Thanh Trì vứt phi tang.<br /><br />Hiện, Tường và Khánh bị bắt khẩn cấp để điều tra hành vi giết người. Bệnh viện Bạch Mai đã đình chỉ công tác với Tường.<br /><br />Theo điều tra, Tường làm bác sĩ khoa Ngoại chuyên ngành xương khớp, mở Thẩm mỹ viện Cát Tường khoảng 6 tháng, chưa được cấp phép thực hiện phẫu thuật thẩm mỹ.</p>',1,0,0,12,'2013-10-29 15:18:19',747,'','2013-10-29 15:26:21',747,747,'2013-10-29 15:26:21','2013-10-29 15:18:19','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,1,'','',1,2,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'vi-VN',''),
 (3,44,'Việc Làm 02',0x766965632D6C616D2D32,'','<p>Việc Làm 01</p>','',1,0,0,12,'2013-10-29 15:18:19',747,'','2013-10-29 15:18:48',747,0,'0000-00-00 00:00:00','2013-10-29 15:18:19','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,0,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'vi-VN',''),
 (4,45,'7 sự thật bất ngờ về Mặt Trời',0x372D73752D746861742D6261742D6E676F2D76652D6D61742D74726F69,'','<p>Mặt Trời nằm rất xa Trái Đất khiến ánh sáng cần khoảng 8 phút 19 giây để có thể đến được Trái Đất còn một chiếc máy bay phải bay trong 26 năm mới có thể đến được ngôi sao trung tâm của Thái Dương hệ.<br />Mặt trời sẽ qua đời như thế nào</p>\r\n','\r\n<p><br />1. Kích thước khổng lồ<br />mat-troi_1383009530_1383009541.jpg<br /><br />Trên thực tế, kích thước lớn của mặt trời có thể chứa được khoảng một triệu Trái Đất bên trong. Khối lượng của mặt trời chiếm khoảng 99.8 % tổng khối lượng của hệ Mặt Trời, gấp 330.000 lần tổng khối lượng trên Trái Đất. <br /><br />2. Năng lượng cực lớn<br /><br />Nhiệt độ bề mặt của Mặt Trời vào khoảng 5.537 độ C, trong khi đó nhiệt độ bên trong lõi của Mặt Trời lên đến khoảng 15 triệu độ C. Năng lượng được sinh ra từ lõi Mặt Trời về cơ bản giải phóng ra nhiệt và ánh sáng mà chúng ta thường nhận được từ Trái Đất. Theo ước tính, năng lượng được sinh ra từ Mặt Trời tương đương với năng lượng khi cho nổ 100 tỷ tấn thuốc nổ.<br /><br />3. Không phải Copernicus đưa ra giả thuyết Mặt Trời là trung tâm của Thái Dương hệ<br />o-COPERNICUS-570-2174-1383011081.jpg<br /><br />Chân dung nhà thiên văn học Nicolas Copernicus. Ảnh: Wikicommons<br /><br />Nhà thiên văn học Nicolas Copernicus không phải là người đầu tiên đưa ra giả thuyết Mặt Trời là trung tâm của hệ Mặt Trời như lâu nay mọi người biết đến. Trên thực tế, nhà thiên văn học người Hy Lạp Aristarchus ở Samos được coi là người đầu tiên đề xuất mô hình có tên gọi là Nhật tâm vào khoảng thế kỷ III trước công nguyên, tức gần 1.800 năm trước khi Copernicus khẳng định.<br /><br />4. Nằm rất xa Trái Đất <br /><br />Mặt Trời nằm cách Trái Đất khoảng 150 triệu km. Với khoảng cách rất xa này, ánh sáng cần khoảng 8 phút 19 giây để có thể đến được Trái Đất. Theo tính toán của các nhà khoa học làm việc tại Cơ quan Hàng không Vũ trụ Mỹ NASA, nếu một chiếc máy bay trên Trái Đất muốn tới được Mặt Trời phải bay liên tục trong 26 năm.<br /><br />5. Lực hấp dẫn lớn<br /><br />Khi ở trên \"quả cầu lửa\", một người nặng trung bình 68 kg ở trên Trái Đất sẽ có trọng lượng khoảng 1.900 kg. Điều này được các nhà khoa học lí giải là do Mặt Trời có lực hấp dẫn gấp 28 lần so với lực hấp dẫn trên hành tinh của chúng ta. <br /><br />6. Mặt Trời \"già\"<br /><br />Cho đến nay, Mặt Trời được ước tính đã 4.6 tỷ năm tuổi và đang trải qua giai đoạn 5 tỷ năm cuối cùng trước khi bắt đầu đốt cháy heli, trở thành một ngôi sao đỏ khổng lồ và sẽ nuốt Sao Kim, Sao Thủy, có thể là cả Trái Đất. Sau khoảng 1 tỷ năm làm một ngôi sao đỏ, Mặt Trời sẽ co lại thành một ngôi sao lùn trắng.<br /><br />7. Đảo chiều cực <br />SUN-FLIP-570_1382956730.jpg<br /><br />Hiện tượng đảo cực của Mặt Trời. Ảnh: NASA<br /><br />Khi đạt mức năng lượng tối đa hay còn gọi là giai đoạn hoạt động lớn nhất, từ trường của Mặt Trời đảo ngược chiều phân cực, về cơ bản lúc này cực bắc và cực nam sẽ đổi chiều cho nhau. Các nhà khoa học cho biết Mặt Trời sẽ đảo chiều cực khoảng 11 năm một lần và đã quan sát thấy sự đảo chiều bắt đầu vào tháng 8 năm nay.</p>',1,0,0,8,'2013-10-29 15:46:58',747,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2013-10-29 15:46:58','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,4,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),
 (5,46,'Siêu máy tính dự báo bão',0x736965752D6D61792D74696E682D64752D62616F2D62616F,'','<p>Siêu máy tính do các nhà nghiên cứu Anh chế tạo có thể dự báo cường độ và đường đi của một cơn bão 4 ngày trước khi hình thành.</p>\r\n','\r\n<p><br />Siêu máy tính dự báo thời tiết có thể dự báo một cơn bão 4 ngày trước khi hình thành. Ảnh: SWNS<br /><br />Để dự đoán đường đi cũng như mức độ lớn nhỏ của cơn bão, siêu máy tính sử dụng các các tính toán được thực hiện từ hàng triệu điểm trên toàn thế giới để mô phỏng tình hình thời tiết, Telegraph cho hay.<br /><br />Bằng cách sử dụng dữ liệu từ các trạm dự báo thời tiết, các vệ tinh, tàu thuyền, máy bay hay các phao argo, siêu máy tính có thể thiết lập bản đồ hình thành cơn bão nhiều ngày trước khi bão đổ ập vào các khu vực dự báo. Đây là những dữ liệu được tích hợp từ các khu vực dưới bề mặt đại dương và truyền lại các thông tin liên quan đến nhiệt độ nước, một nhân tố ảnh hưởng đến hệ thống thời tiết toàn cầu.<br /><br />Với khả năng thực hiện khoảng 100.000 tỷ phép tính trong một giây, siêu máy tính đã dự đoán được cơn bão lịch sử St Jude\'s Day 4 ngày trước khi ập vào nước Anh hôm qua.<br /><br />Trước đó, siêu máy tính phát hiện thấy hai vùng thời tiết hỗn loạn ở Canada và Mỹ khi cả hai vùng cùng gặp nhau tại một điểm ở phía tây Đại Tây Dương, tạo thành vùng áp lực thấp rộng lớn trước khi hình thành bão.<br /><br />\"Tính chính xác của chiếc siêu máy tính đã dự báo được các nhân tố góp phần hình thành nên cơn vão lịch sử xảy ra tại Anh vào tối qua\", Dan Williams, người phát ngôn của Cơ quan Khí tượng Thủy văn Anh (Met), đơn vị sản xuất siêu máy tính, cho biết. <br /><br />Siêu máy tính được đặt trong một ngôi nhà đặc biệt có diện tích rộng gấp hai lần sân bóng đá và sử dụng nguồn điện có công suất 1.2 MW, đủ để cung cấp điện cho một thị trấn nhỏ.<br /><br />Cơ quan Khí tượng Thủy văn Anh cho biết chiếc siêu máy tính hiện tại có giá khoảng 48 triệu USD (30 triệu bảng Anh). Met cũng sẽ chế tạo một chiếc siêu máy tính dự báo thời tiết mang nhãn hiệu IBM có giá khoảng 160 triệu USD (100 triệu bảng Anh) trong vòng hai năm tới.</p>',1,0,0,8,'2013-10-29 15:48:08',747,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2013-10-29 15:48:08','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,3,'','',1,1,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),
