 (10019,'HD FLV Player','plugin','hdflvplayer','content',0,1,1,0,'{\"legacy\":false,\"name\":\"HD FLV Player\",\"type\":\"plugin\",\"creationDate\":\"May 2013\",\"author\":\"Apptha\",\"copyright\":\"Copyright (C) 2011 Powered by Apptha\",\"authorEmail\":\"support@apptha.com\",\"authorUrl\":\"http:\\/\\/www.apptha.com\",\"version\":\"2.1\",\"description\":\"\\n         <p>Plugin Steps<\\/p>\\n<p>1. Install the joomla_hdflvplayer_plugin.<br \\/>\\n  2. In the plugin manager under extensions menu Hdflvplayer Plugin can be found.<br \\/>\\n  3. Just publish it.<br \\/>\\n  4. In any articles plugin can be used...<br \\/>\\n  5. The attributes includes <\\/p>\\n<p> * videoid<br \\/>\\n  * Height<br \\/>\\n  * Width<br \\/>\\n  * Autoplay<br \\/>\\n  * Playlist<\\/p>\\n<p>6. Any one of the above attributes can be included...Mandatory is videoid<br \\/>\\n  7. Below are the formats for plugin<\\/p>\\n<p> <br \\/>\\n  1.[hdplay videoid=1 height=300 width=400 autoplay=true playlist=summer]<br \\/>\\n  2.[hdplay videoid=1]<br \\/>\\n  3.[hdplay videoid=2 height=300] <br \\/>\\n  4.[hdplay videoid=4 width=700] <br \\/>\\n  5.[hdplay videoid=3 autoplay=true] <br \\/>\\n  6.[hdplay videoid=3 playlist=summer] <\\/p>\\n<p>Different combinations can be used as mentioned above<br \\/>\\n<\\/p>\\n\",\"group\":\"\"}','{}','','',0,'0000-00-00 00:00:00',0,0),
