INSERT INTO `jl_fpss_slides` (`id`,`asset_id`,`title`,`catid`,`published`,`publish_up`,`publish_down`,`created`,`created_by`,`modified`,`modified_by`,`access`,`ordering`,`featured`,`featured_ordering`,`text`,`tagline`,`referenceType`,`referenceID`,`custom`,`video`,`hits`,`language`,`params`) VALUES 
 (1,43,'Frontpage Slideshow',1,1,'2013-10-26 08:40:11','0000-00-00 00:00:00','2013-10-26 08:40:11',747,'0000-00-00 00:00:00',0,1,1,0,1,'\n        Frontpage SlideShow is the most eye-catching way to display your featured articles, stories or even products in your Joomla! based website.\n      ','Eye-candy for any Joomla! based website','custom',0,'http://www.frontpageslideshow.net/','',1,'*','{\"title\":\"\",\"text\":\"\",\"tagline\":\"\",\"category\":\"\",\"author\":\"\",\"readmore\":\"\",\"target\":\"\",\"liveData\":\"\"}'),
 (2,44,'Frontpage Slideshow is Search Engine Friendly!',1,1,'2013-10-26 08:40:11','0000-00-00 00:00:00','2013-10-26 08:40:11',747,'0000-00-00 00:00:00',0,1,2,0,1,'\n        Unlike Flash based slideshows, Frontpage Slideshow uses CSS and Javascript wizardry only. The content of the slides is laid out as html code, which means it can be crawled by search engines. The proper usage (and order) of h1, h2, p (and more) tags will make sure Google (or any other search engine) regularly indexes your latest/featured items.\n      ','…And iPhone & iPad friendly too!','custom',0,'http://www.joomlaworks.net/fpss','',0,'*','{\"title\":\"\",\"text\":\"\",\"tagline\":\"\",\"category\":\"\",\"author\":\"\",\"readmore\":\"\",\"target\":\"\",\"liveData\":\"\"}'),
 (3,45,'Unlimited slideshows, MVC templating',1,1,'2013-10-26 08:40:11','0000-00-00 00:00:00','2013-10-26 08:40:11',747,'0000-00-00 00:00:00',0,1,3,0,1,'\n        Create unlimited slideshows within your Joomla! site. Use the power of MVC tempting to create new slideshow templates or modify the pre-packaged ones. This slide is linked by default to an article, which is part of the default Joomla! sample data.\n      ','Powerful, yet simple to use','com_content',1,'','',0,'*','{\"title\":\"\",\"text\":\"\",\"tagline\":\"\",\"category\":\"\",\"author\":\"\",\"readmore\":\"\",\"target\":\"\",\"liveData\":\"\"}'),
 (4,46,'Powers thousands of sites worldwide',1,1,'2013-10-26 08:40:11','0000-00-00 00:00:00','2013-10-26 08:40:11',747,'0000-00-00 00:00:00',0,1,4,0,1,'\n        Frontpage Slideshow is used in websites visited by millions of people everyday around the world like Linux.com, BettyConfidential.com, the World Health Organization and many more. This slide is linked by default to a menu item, which is part of the default Joomla! sample data.\n      ','From corporate sites to \"big league\" magazines & portals','com_menus',1,'','',0,'*','{\"title\":\"\",\"text\":\"\",\"tagline\":\"\",\"category\":\"\",\"author\":\"\",\"readmore\":\"\",\"target\":\"\",\"liveData\":\"\"}');
