 (3211,'JGLOBAL_FILTER_TYPE_DESC','<p>Black List allows all tags and attributes except for those in the black list.<br /><strong>--</strong> Tags for the Default Black List include: \'applet\', \'body\', \'bgsound\', \'base\', \'basefont\', \'embed\', \'frame\', \'frameset\', \'head\', \'html\', \'id\', \'iframe\', \'ilayer\', \'layer\', \'link\', \'meta\', \'name\', \'object\', \'script\', \'style\', \'title\', \'xml\'<br /><strong>--</strong> Attributes for the Default Black List include: \'action\', \'background\', \'codebase\', \'dynsrc\', \'lowsrc\'<br /><strong>--</strong> You can black list additional tags and attributes by adding to the Filter Tags and Filter Attributes fields, separating each tag or attribute name with a comma.<br /><strong>--</strong> Custom Black List allows you to override the Default Black List. Add the tags and attributes to be black listed in the Filter Tags and Filter Attributes fields.</p><p>White List allows only the tags listed in the Filter Tags and Filter Attributes fields.</p><p>No HTML removes all HTML tags from the content when it is saved.</p><p>Please note that these settings work regardless of the editor that you are using. <br />Even if you are using a WYSIWYG editor, the filtering settings may strip additional tags and attributes prior to saving information in the database.</p>','C:\\Others\\Projects\\Joomla\\Joomla_2.5.14\\administrator\\language\\en-GB\\en-GB.ini'),
